import './App.css';
import {Header, Ingredients, NavBar, Recipe} from './Components';

function App() {
  return (
    <div>
      <NavBar />
      <Header />
      <Ingredients />
      <Recipe />
      <h1> Hello world! </h1>
    </div>
  );
}

export default App;
